import React from 'react';
import './QuestionBoxHeader.css';

const questionBoxHeader = props =>{
    return(
        <div className='QuestionBoxHeader'>
            <div><span style={{fontWeight:'bolder'}}>Usuário:</span> {props.user}</div>
            <div>Número de respostas: {props.answers}</div>
        </div>
    );
};

export default questionBoxHeader;
